//Import counter class component from src..component
//import CounterClass from './components/counterClass';
//import CounterFunction from './components/counterFunction';
import './App.css';

//Rusiru's video implement parts



import AddVehicle from './components/AddVehicle';
import AllVehicle from './components/AllVehicles'
import EditVehiDetails from './components/UpdateVehicle';
import manager from './components/Manager';
import packReport from './components/report'



//import { Router } from 'react-router-dom';
import {BrowserRouter as Router, Route} from "react-router-dom"

function App() {
  return (

  <Router>
    <div class="1">

    <Route path="/vehi" exact component={AddVehicle}></Route> 
    <Route path="/man" exact component={manager}></Route>
    <Route path="/search" exact component={AllVehicle}></Route>
    <Route path="/UpdateVehicle/:id" exact component={EditVehiDetails}></Route>
    <Route path="/rep" exact component={packReport}></Route>

  </div> 
</Router> 

);
} 

export default App;
